import React from 'react';

const GameConsole = (props) => {
    let display = [...props.currentWord].map((char)=>{
        return (props.correctlyGuessed.includes(char) ? char : "_")
    }).join("")
     return (
        <div>
            {display}
        </div>

     )
}

export default GameConsole
